import Header from "./Components/Header/Header";

const useStyles = makeStyles(()=>({
App:{
  backgroundcolor:"#14161a",
  color:"#fffff",
  minHeight:"100vh",
}
}));

function App() {
  return (
    <BrowserRouter>
      <div className={classes.App}>
        <Header />
        <Routes>
          <Route path="/" element={<Home />} exact />
          <Route path="/coins/:id" element={<Detail />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
